import { makeStyles } from "@mui/styles";


export const useStyles = makeStyles({
  blog:{
    display:'flex',
    marginTop:105,
    width:'100%',
  },
  img:{
    marginLeft:'100px',
    flexGrow:1,
    '& img':{float:"right"}
  },
})
